import React, { Component } from 'react';
import Card from './Card';
import Card2 from './Card2';
import './Works.css';
import Workscards from './Workscards';


class Works extends Component{

  static defaultProps={
    menu:[
      {name: "home", icon: "home.svg", src: home}, 
      {name: "text", icon: "text.svg", src: text},
      {name: "works", icon: "works.svg", src: works},
      {name: "about", icon: "monster.svg", src: monster}
    ]
  }

    constructor(props){
        super(props);
        this.state = {
          data:[]
        }
      }

    componentDidMount(){
        fetch('https://raw.githubusercontent.com/fernandocomet/website/master/fernandocomet/src/data/portfolio.json')
          .then(response => response.json())
          .then(data => this.setState({ data }))
    }


    render(){
        return(
          <div>
              <h1>Here Navigation</h1>
              <Workscards />
          </div>
        )
    }

}

export default Works;

